import "./ExpensesList";
import ExpenseItem from "./ExpenseItem";
//
const ExpensesList = (props) => {
  //
  let expenseContent = <p>Nothing here folks!</p>;
  if (props.items.length === 0) {
    return <h2>Nothing found here folks!</h2>;
  }
  //
  return (
    <ul className="expenses-list">
      {props.items.map((item) => {
        return (
          <ExpenseItem
            key={item.id}
            title={item.title}
            amount={item.amount}
            date={item.date}
          />
        );
      })}
    </ul>
  );
};

export default ExpensesList;
